import React, {Component, Fragment} from 'react';
import {Col, Container, Row} from "react-bootstrap";

class Services extends Component {
    render() {
        return (
            <Fragment>
                <Container>
                    <Row>
                        <Col lg={4} md={6} sm={12}>
                            <h1>1 </h1>
                        </Col>
                        <Col lg={4} md={6} sm={12}>
                            <h1>2</h1>
                        </Col>
                        <Col lg={4} md={6} sm={12}>
                            <h1>3</h1>
                        </Col>
                    </Row>

                </Container>
            </Fragment>
        )
            ;
    }
}

export default Services;
